import React from 'react'
import {clicar} from '../App'
import ReactDOM from 'react-dom'
import Stories from './Storie'
import App from '../App';

export default (props) => {
	const cursor = props.cursor
	const hand = {cursor:cursor || 'pointer'}
	

	return(
	<div className="Profile">

			<div className="Profilefoto" onClick={clicar} style={hand}></div>

			<div className="ProfileText">
				<h2>{props.nome}</h2>
				<p>{props.text}</p>
				<br/><br/>
				<span>doe bitcoin:</span><br/>
				<span>{props.bitcoin}</span>
			</div>
	</div>
	
	)
}

export function fechar(){
      ReactDOM.forceUpdate(<App />,document.getElementById('root'));
